    //使用字典
    static func lengthOfLongestSubstring(_ s: String) -> Int {
        let startDate = Date()
        var seenCharacters: [Character: Int] = [:] // 存储字符和其索引
        var start = 0 // 滑动窗口的起点
        var maxLength = 0

        for (index, character) in s.enumerated() {
            if let previousIndex = seenCharacters[character], previousIndex >= start {
                // 如果字符重复并且索引在窗口范围内，移动窗口起点
                start = previousIndex + 1
            }
            // 更新字符的索引
            seenCharacters[character] = index
            // 计算当前窗口的长度
            maxLength = max(maxLength, index - start + 1)
        }
        let endDate = Date()
        print(endDate.timeIntervalSince(startDate))
        return maxLength
    }
